const ImageGridListStyle = theme => ({
	root: {
		display: 'flex',
		flexWrap: 'wrap',
		justifyContent: 'space-around',
		overflow: 'hidden',
		backgroundColor: "#fff",
	},
	gridList: {
		width: 500,
		height: 450,
	},
});

export default ImageGridListStyle;
